    return(
        <a href={list.link}>{list.target}</a>
    )
    }
)

class Search extends Component{
    style = {
        'min-width': '32px',
        'height': '72px',
    }
    render(){ 
        return(
            <div className='search-warp clearfix' style = {style}></div>
